import json
import pandas as pd
import numpy as np

# Read the Excel files
def load_data():
    try:
        climate_df = pd.read_excel('/home/gridsan/elai/Kramabench/data/archeology/input/climateMeasurements.xlsx')
        radiocarbon_df = pd.read_excel('/home/gridsan/elai/Kramabench/data/archeology/input/radiocarbon_database_regional.xlsx')
        return {"subtask-1": "Data loaded successfully", "climate_df": climate_df, "radiocarbon_df": radiocarbon_df}
    except Exception as e:
        return {"subtask-1": f"Error loading data: {str(e)}"}

# Find first and last times for Maltese area
def get_maltese_times(radiocarbon_df):
    try:
        malta_data = radiocarbon_df[radiocarbon_df['Region'].str.contains('Malta', na=False, case=False)]
        if malta_data.empty:
            return {"subtask-2": "No Maltese data found"}

        # Convert to numeric, handling any non-numeric values
        malta_data['Date'] = pd.to_numeric(malta_data['Date'], errors='coerce')

        first_time = malta_data['Date'].min()
        last_time = malta_data['Date'].max()

        return {
            "subtask-2": "Times identified successfully",
            "first_time": first_time,
            "last_time": last_time
        }
    except Exception as e:
        return {"subtask-2": f"Error processing Maltese times: {str(e)}"}

# Get Potassium values
def get_potassium_values(climate_df, times):
    try:
        # Ensure Time column is numeric
        climate_df['Time'] = pd.to_numeric(climate_df['Time'], errors='coerce')

        # Get closest values for first and last times
        first_k = climate_df.loc[(climate_df['Time'] - times['first_time']).abs().idxmin()]['Potassium']
        last_k = climate_df.loc[(climate_df['Time'] - times['last_time']).abs().idxmin()]['Potassium']

        return {
            "subtask-3": "Potassium values extracted",
            "first_k": first_k,
            "last_k": last_k
        }
    except Exception as e:
        return {"subtask-3": f"Error getting Potassium values: {str(e)}"}

# Calculate final average
def calculate_average(k_values):
    try:
        avg_k = (k_values['first_k'] + k_values['last_k']) / 2
        rounded_avg = round(float(avg_k), 4)
        return {"main-task": rounded_avg}
    except Exception as e:
        return {"main-task": f"Error calculating average: {str(e)}"}

# Main execution
def main():
    # Load data
    data_result = load_data()
    if "Error" in str(data_result["subtask-1"]):
        print(json.dumps(data_result, indent=4))
        return

    # Get Maltese times
    times_result = get_maltese_times(data_result["radiocarbon_df"])
    if "Error" in str(times_result.get("subtask-2", "")):
        print(json.dumps(times_result, indent=4))
        return

    # Get Potassium values
    k_values = get_potassium_values(data_result["climate_df"], times_result)
    if "Error" in str(k_values.get("subtask-3", "")):
        print(json.dumps(k_values, indent=4))
        return

    # Calculate final average
    final_result = calculate_average(k_values)

    # Print all results
    print(json.dumps({
        "subtask-1": data_result["subtask-1"],
        "subtask-2": times_result["subtask-2"],
        "subtask-3": k_values["subtask-3"],
        "main-task": final_result["main-task"]
    }, indent=4))

if __name__ == "__main__":
    main()

