    malta_data = df[df['Region'].str.contains('Malta', case=False, na=False)]
    return malta_data

# Subtask 3 & 4: Get min and max years
def get_year_range(malta_data):
    # Try to find columns related to dates/years
    year_columns = [col for col in malta_data.columns if 'year' in col.lower() or 'date' in col.lower()]

    if not year_columns:
        return {"status": "error", "message": "No year/date columns found"}

    results = {}
    for col in year_columns:
        # Convert to numeric, handling errors
        malta_data[col] = pd.to_numeric(malta_data[col], errors='coerce')
        min_year = malta_data[col].min()
        max_year = malta_data[col].max()

        if not (pd.isna(min_year) or pd.isna(max_year)):
            results[col] = {
                "min_year": min_year,
                "max_year": max_year
            }

    return {"status": "success", "data": results}

# Main execution
file_path = '/home/gridsan/elai/Kramabench/data/archeology/input/radiocarbon_database_regional.xlsx'

