    print(json.dumps({"subtask-1": "Successfully loaded data"}, indent=4))

    # Execute subtask 2
    malta_data = filter_malta_data(df)
    print(json.dumps({"subtask-2": f"Found {len(malta_data)} records for Malta"}, indent=4))

    # Execute subtask 3 & 4
