import json
import numpy as np

def process_rank(rank_str):
    # Handle NaN
    if pd.isna(rank_str):
        return None

    # Convert to string to handle potential numeric values
    rank_str = str(rank_str)

    # If contains 'or', split and average the numbers
    if 'or' in rank_str:
        parts = rank_str.split('or')
        numbers = []
        for part in parts:
            try:
                numbers.append(float(part.strip()))
            except ValueError:
                continue
        if numbers:
            return sum(numbers) / len(numbers)
    else:
        try:
            return float(rank_str)
        except ValueError:
            return None

