import pandas as pd
import json

# Read the CSV file
def load_and_check_data():
    try:
        df = pd.read_csv('/home/gridsan/elai/Kramabench/data/archeology/input/worldcities.csv')
        return {
            "success": True,
            "data": df,
            "columns": list(df.columns)
        }
    except Exception as e:
        return {
            "success": False,
            "error": str(e)
        }

# Filter cities in southern and western hemispheres
def filter_cities(df):
    try:
        # Ensure lat and lng are numeric
        df['lat'] = pd.to_numeric(df['lat'], errors='coerce')
        df['lng'] = pd.to_numeric(df['lng'], errors='coerce')

        # Filter for southern hemisphere (negative latitude) and western hemisphere (negative longitude)
        filtered_df = df[
            (df['lat'] < 0) & 
            (df['lng'] < 0)
        ]
        return filtered_df
    except Exception as e:
        return None

# Find city with highest population
def find_highest_population_city(df):
    try:
        # Ensure population is numeric
        df['population'] = pd.to_numeric(df['population'], errors='coerce')

        # Sort by population and get the top city
        result = df.sort_values('population', ascending=False).iloc[0]
        return {
            "city": result['city'],
            "population": int(result['population']),
            "country": result['country'],
            "lat": float(result['lat']),
            "lng": float(result['lng'])
        }
    except Exception as e:
        return None

# Execute the analysis
result = {}

# Subtask 1: Load and check data
data_check = load_and_check_data()
result["subtask-1"] = {
    "success": data_check["success"],
    "columns": data_check["columns"] if data_check["success"] else None
}

if data_check["success"]:
    # Subtask 2: Filter cities
    filtered_cities = filter_cities(data_check["data"])
    result["subtask-2"] = {
        "num_cities_filtered": len(filtered_cities) if filtered_cities is not None else 0
    }

    # Subtask 3 and Main task: Find highest population city
    if filtered_cities is not None:
        highest_pop_city = find_highest_population_city(filtered_cities)
        result["subtask-3"] = highest_pop_city
        result["main-task"] = highest_pop_city["city"] if highest_pop_city else None

# Print the results
print(json.dumps(result, indent=4))

