import pandas as pd
import json

# Read the CSV file
def load_and_validate_data(file_path):
    try:
        df = pd.read_csv(file_path)
        return {"status": "success", "data": df}
    except Exception as e:
        return {"status": "error", "message": str(e)}

# Clean and process population data
def clean_population_data(df):
    try:
        # Convert population to numeric, coerce errors to NaN
        df['population'] = pd.to_numeric(df['population'], errors='coerce')
        # Drop rows where population is NaN
        df = df.dropna(subset=['population'])
        return {"status": "success", "data": df}
    except Exception as e:
        return {"status": "error", "message": str(e)}

# Filter cities by population
def filter_large_cities(df):
    try:
        large_cities = df[df['population'] > 100000].copy()
        # Sort by population in descending order
        large_cities = large_cities.sort_values('population', ascending=False)
        return {"status": "success", "data": large_cities}
    except Exception as e:
        return {"status": "error", "message": str(e)}

# Main execution
file_path = '/home/gridsan/elai/Kramabench/data/archeology/input/worldcities.csv'

# Execute subtask-1: Load data
result_1 = load_and_validate_data(file_path)
if result_1["status"] == "error":
    print(json.dumps({"subtask-1": f"Error: {result_1['message']}"}, indent=4))
    exit()

# Execute subtask-2: Clean population data
result_2 = clean_population_data(result_1["data"])
if result_2["status"] == "error":
    print(json.dumps({"subtask-2": f"Error: {result_2['message']}"}, indent=4))
    exit()

# Execute subtask-3: Filter large cities
result_3 = filter_large_cities(result_2["data"])
if result_3["status"] == "error":
    print(json.dumps({"subtask-3": f"Error: {result_3['message']}"}, indent=4))
