import pandas as pd
import os

def examine_file_columns(filepath):
    if filepath.endswith('.csv'):
        try:
            # Read just the column names first
            df = pd.read_csv(filepath, nrows=0)
            return list(df.columns)
        except Exception as e:
            return f"Error reading CSV: {str(e)}"
    elif filepath.endswith('.xlsx'):
        try:
            # Read Excel file info
            xls = pd.ExcelFile(filepath)
            return {
                "sheets": xls.sheet_names,
                "columns": list(pd.read_excel(filepath, sheet_name=0, nrows=0).columns)
            }
        except Exception as e:
            return f"Error reading Excel: {str(e)}"

# Initialize results dictionary
results = {}

# Base directory
base_dir = '/home/gridsan/elai/Kramabench/data/archeology/input/'

# Examine each file
for filename in ['worldcities.csv', 'conflict_brecke.csv', 'roman_cities.csv', 
                 'climateMeasurements.xlsx', 'radiocarbon_database_regional.xlsx']:
    filepath = os.path.join(base_dir, filename)
    columns = examine_file_columns(filepath)
    results[filename] = columns

# Analyze which file is likely to contain modern cities
modern_cities_file = None
for filename, columns in results.items():
    if isinstance(columns, list):  # For CSV files
        # Look for typical modern city columns
        relevant_columns = ['city', 'population', 'country', 'lat', 'lng']
        if any(col.lower() in str(columns).lower() for col in relevant_columns):
            if 'roman' not in filename.lower():  # Exclude roman cities
                modern_cities_file = filename
                break

# Prepare the answer
answer = {
    "subtask-1": {
        "csv_files_columns": {
            k: v for k, v in results.items() if k.endswith('.csv')
        }
    },
    "subtask-2": {
        "excel_files_info": {
