# Load the conflict data
def load_conflict_data():
    try:
        df = pd.read_csv('/home/gridsan/elai/Kramabench/data/archeology/input/conflict_brecke.csv')
        # Convert year columns to numeric, coerce errors to NaN
        df['StartYear'] = pd.to_numeric(df['StartYear'], errors='coerce')
        df['EndYear'] = pd.to_numeric(df['EndYear'], errors='coerce')
        return df
    except Exception as e:
        print(f"Error loading conflict data: {e}")
        return None

# Load the cities data
def load_cities_data():
    try:
        return pd.read_csv('/home/gridsan/elai/Kramabench/data/archeology/input/worldcities.csv')
    except Exception as e:
        print(f"Error loading cities data: {e}")
        return None

# Main processing
def process_conflicts():
    results = {}

    # Subtask 1: Load and clean conflict data
    conflicts_df = load_conflict_data()
    if conflicts_df is not None:
        results["subtask-1"] = {"loaded_rows": len(conflicts_df)}

    # Subtask 2: Filter conflicts between 800 and 1400 AD that lasted at least one year
    filtered_conflicts = conflicts_df[
        (conflicts_df['StartYear'] >= 800) & 
        (conflicts_df['StartYear'] <= 1400) &
        (conflicts_df['EndYear'] - conflicts_df['StartYear'] >= 1)
    ].copy()
    results["subtask-2"] = {"filtered_conflicts": len(filtered_conflicts)}

    # Subtask 3: Load cities data
    cities_df = load_cities_data()
    if cities_df is not None:
        results["subtask-3"] = {"loaded_cities": len(cities_df)}

    # Subtask 4: Map to modern countries
    # Note: This is a simplified mapping approach. In reality, you might need more
    # sophisticated geographic matching
    if 'Location' in filtered_conflicts.columns:
        filtered_conflicts['country'] = filtered_conflicts['Location'].str.extract(r'\((.*?)\)').iloc[:, 0]
    results["subtask-4"] = {"mapped_conflicts": filtered_conflicts['country'].notna().sum()}

    # Subtask 5: Count conflicts by country
    country_counts = filtered_conflicts['country'].value_counts().to_dict()
    results["subtask-5"] = {"country_counts": country_counts}

    # Main task result
    results["main-task"] = {
        "total_conflicts": len(filtered_conflicts),
        "conflicts_by_country": country_counts
    }

    # Print results
    print(json.dumps(results, indent=4))

# Run the analysis
if __name__ == "__main__":
    process_conflicts()

